import { categories } from "./categorieslist";
import "./categories.css";
import React from "react";

export function Category() {
    return (
      <ul>
        {categories.map(category =>
        <div style={{margin: "1vh", border: "2px solid black", listStyle: "none"}}>
          <li key={category.id}>
            {category.name}
          </li>
          <li key={category.id}>
            {category.priceRange}
          </li>
          <li key={category.id}>
            {category.description}
          </li>
       </div>
        ) }
        <br />
      </ul>
    )
}
